import React from 'react';
import { Route, Switch } from "react-router-dom";
import Homepage from "./home";
import Header from './Layout/Header';
import Footer from './Layout/Footer';
import './App.css';

function App() {
  return (
		<div className="App">
      <Header/>
        <Switch>
				<Route exact path="/" component={Homepage} />
			</Switch>
      <Footer/>
		</div>
	);
}

export default App;
